from orca.braille import Line
class Student():
    def __init__(self):
        self.brIn = ''
        self.ime = ''
        self.prezime = ''
        self.roditelj = ''
        self.jmbg = ''
        self.adresa = ''
        self.brojTelefona = '' 
        self.godinaStudija = 0
    
    def toString(self):
        return  "|".join((self.brIn,self.ime, self.prezime, self.roditelj,self.jmbg, self.adresa, self.brojTelefona, str(self.godinaStudija)))
        
    @staticmethod
    def fromString(line):
        s = Student()
        s.brIn,s.ime,s.prezime,s.roditelj,s.jmbg,s.adresa, s.brojTelefona,s.godinaStudija = line.split("|")
        return s
    
    def upisiGodinu(self):
        self.godinaStudija = int(self.godinaStudija) + 1

studenti = []
for line in open("Studenti","r"):
    s = Student.fromString(line)
    studenti.append(s)

upisaniStudenti = []
for s in studenti :
    s.upisiGodinu()
    print(s.toString(), "\n")
    upisaniStudenti.append(s)

fajl = open("fajl.txt", "w")
def cuvajUFajlu(studenti):
    for s in studenti:
        fajl.write(s.toString())

cuvajUFajlu(upisaniStudenti)

void Sortowanie( int tab[], int left, int right )
{
    int i = left;
    int j = right;
    int x = tab[( left + right ) / 2 ];
    do
    {
        while( tab[ i ] < x )
             i++;
       
        while( tab[ j ] > x )
             j--;
       
        if( i <= j )
        {
            swap( tab[ i ], tab[ j ] );
           
            i++;
            j--;
        }
    } while( i <= j );
   
    if( left < j ) Sortowanie( tab, left, j );
   
    if( right > i ) Sortowanie( tab, i, right );
   
}
